import React, { Component } from 'react';
import imgAbout from './imgAbout.png';

export default class About extends Component {
    render() {
        return (
            <div>
                <h1 className='titlePages'>ABOUT US</h1>

                <div className='aboutInfo'>
                    <div className='aboutInfo1'>
                        <h2>Dulce beauty clinic</h2>
                        <p>At our clinic, we have a team of qualified experts who have been in the beauty industry for several years.
                        The Dulce Beauty clinic offers you a wide choice of high-end services.
                        We prioritize the comfort and the satisfaction of our customers.</p>
                    </div>
                    <div>
                        <img src={imgAbout} alt='imgAbout' className='img-fluid'/>
                    </div>
                </div>
            </div>
        )
    }
}
